import { Component, EventEmitter, Input, Output } from '@angular/core';
import { Book } from 'src/app/models/book';

@Component({
  selector: 'app-card',
  templateUrl: './card.component.html',
  styleUrls: ['./card.component.css']
})
export class CardComponent {

  @Input() book: Book;
  @Output() selectBook = new EventEmitter<string>();

  deleteBook():void{

    this.selectBook.emit(this.book.title)
  }
}

<!-- COMPONENTE HIJO -->
<div class="title"> Los más leídos</div>

<div class="container_books" *ngIf="books.length>0; else noHayLibros">
    <div *ngFor="let book of books; let par = even">
        <div class="card-group">
            <div class="card" style="width: 16rem;" [ngClass]=" par / 2 == 0 ? 'bg-light' : ''">
                <img src="{{book.photo}}" class="card-img-top" alt="...">
                    <div class="card-body">
                        <p class="card-title">{{book.title}}</p>
                    </div>
                        <ul class="list-group">
                            <li class="list-group">{{book.author}}</li>
                            <li class="list-group">{{book.price}} €</li>
                            <li class="list-group">{{book.type}}</li>
                        </ul>
                        <div class="card-link"> {{book.id_book| pipeBook}} </div>
                        <br>
                    <button class="button_even" type="button"> comprar</button> 
                    <button class="button_even" type="button" (click)="deleteBook()">  X </button>     
            </div>    
        </div>    
    </div>
</div> 


<ng-template #noHayLibros>
    <div class="container_books" style="height: 300px;">
        <h2 class="text-templeate">There are no books :(</h2>
    </div>
</ng-template>
